import { Img1, Img2, Img3, Img4, Img5 } from "../Imports/Image";
const DataPopularHome = [
  {
    id: 1,
    price: "$5 - $20",
    img: Img1,
    title: "tasty burger",
    icon: "fas fa-star",
  },
  {
    id: 2,
    price: "$5 - $20",
    img: Img2,
    title: "tasty cakes",
    icon: "fas fa-star",
  },
];
export default DataPopularHome;
